import PropTypes from "prop-types";
import React from "react";

const TeamMemberOneSingle = ({ data, spaceBottomClass }) => {
  return (
    <div>
      <div
        className={ `team-wrapper ${spaceBottomClass ? spaceBottomClass : ""}`}
      >

      <div className="team-content">
        <div className="team-img">
          <img
            alt=""
            // className="img-fluid"
          />
          <div className="team-action">
          <h4>할까 말까</h4>  
            <a
              className="check"
              href= '/accept'
            >
              <i className="fa fa-check" />
            </a>
            <a
              className="remove"
              href='/reject'
            >
              <i className="fa fa-remove" />
            </a>
          </div>
        </div>
          {/* <h4>{data.name}</h4> */}
          <h4>{data.contents} </h4>
          <span>{data.location}</span>
          <span>{data.start}{data.end !='' ? '~' : ''}{data.end}</span>
        </div>
      </div>
    </div>
  );
};

TeamMemberOneSingle.propTypes = {
  data: PropTypes.object,
  spaceBottomClass: PropTypes.string
};

export default TeamMemberOneSingle;
